import dynamic from "next/dynamic";
import Link from "next/link";
const Background = dynamic(() =>
    import("components/landing/background/Clouds")
);

export default function Duo() {
    return (
        <div className="container height--full-plus background--brand-type1--lv2">
            <div className="spacer height--lv11" />
            <div className="row">
                <div className="spacer flex--1" />
                <div className="col size4of8 justify-content--center">
                    <div className="text text-align--center--mobile">
                        <h2 className="heading hero--lv3">Neudify Duo</h2>
                        <p className="hero--lv3">Enjoy each other even more</p>
                        <p className="hero--lv3">
                            Self-care together with your partner, a lover or a friend. Neudify is a must have to start your sexual happiness journey in company.
                        </p>
                    </div>
                </div>
            </div>
            <div className="spacer height--lv11" />
            <Background />
        </div>
    );
}
